Imps.description:
The Imps are 10.000 randomly generated, animated, 3D characters on the Ethereum blockchain. Each one is completely unique but some are more rare than others. Each trait is handcrafted by SuperNfty in his signature floaty style.

Check out the [genesis collection](https://opensea.io/collection/super-nfty-floating-heads) and read more about SuperNfty on [Supernfty.com](https://www.supernfty.com/) or [Impsnft.com](https://www.impsnft.com/). Join the [Discord](https://discord.gg/supernfty), talk to other collectors and join the owners-exclusive chatrooms:
@SuperNfty On [Twitter](https://twitter.com/SuperNfty) and [Instagram](https://www.instagram.com/supernfty/)

