Colonists.description:
Colonists are an NFT collection of 25,000 uniquely generated space animals, redeemable for their cosmetic attributes and in-game cryptocurrency in our upcoming MMO on the blockchain Colony Online. 

There are 5 initial species of Colonists; Bears, Apes, Ducks, Cats and Dogs. Each species is dropped one by one, in batches of 5,000 during our minting phase. These species will never be re-introduced to the game beyond this initial collection. Minting your Colonists gives you completely randomized traits when it comes to fur color, hats, space suits etc;

For additional info on this collection visit: [https://www.colony.online/](https://www.colony.online/)
